import morning from "./image/morning.png"
import night from "./image/night.jpg"

const IsdayComponent = (props) => {
    if(props.value) {
        return (
            <>
            <img src={morning} />
            </>
        )
    }
    else {
        return (
            <>
            <img src={night} />
            </>
        )
    }
}
export default IsdayComponent;
